import { withRouter } from 'react-router';
import {withFirebase} from '../../server/Firebase/index';
import React, { Component } from "react";

class Search extends Component {
  constructor(props) {
    super(props);
    this.state = {
      addresses: []
    };
  }
  componentDidMount(){
    const h = this.props.firebase.database.ref('houses');
    h.on('value', (snapshot) => {
      let hs = snapshot.val();
      let value= [];
      console.log(hs.propertyInfor);
      value.push(hs.propertyInfor.details.address);
      this.setState({
        addresses: value
      });
    });
  }

  render(){
    console.log(this.state.addresses);
    return(
      <div></div>
    );
  }
}
export default withFirebase(Search);
